import React, { Component } from 'react';

class Calibration extends Component {
   confirmClick = () => {
      console.log("clicked")
   };

   render() {
      return (
         <main className="container d-flex justify-content-center">
            <div className="jumbotron bg-transparent">
               <SoundSelectExpanded />
               <SoundSelectDropdown />
               <div className="row">
                  <div className="form-check">
                     <input className="form-check-input" type="checkbox" value="" id="soundSet50" onClick={this.props.disable} />
                     <label className="form-check-label" htmlFor="soundSet50">
                        I confirm that my volume is at 50%
                     </label>
                  </div>
               </div>
            </div>
         </main>
      );
   }
}

class SoundSelectExpanded extends Component {
   render() {
      return (
         <div className="row flex-nowrap sound-selection-expanded">
            <div className="col-sm " type="button">
               <img className="img-responsive" src="./img/screening_icons/screening-laptop-selection.jpg" alt="laptop" />
               <p>Computer Speakers</p>
            </div>
            <div className="col-sm ">
               <img className="img-responsive" src="./img/screening_icons/screening-headphone-selection.jpg" alt="over ear headphone" />
               <p>Overear Headphones</p>
            </div>
            <div className="col-sm ">
               <img className="img-responsive" src="./img/screening_icons/screening-wiredearbud-selection.jpg" alt="wired earbuds" />
               <p>Wired Headphones</p>
            </div>
            <div className="col-sm">
               <img className="img-responsive" src="./img/screening_icons/screening-earpod-selection.jpg" alt="bluetooth earpods" />
               <p>Bluetooth Headphones</p>
            </div>
         </div>
      );
   }
}

class SoundSelectDropdown extends Component {
   render() {
      return (
         <div className="row">
            <select className="custom-select">
               <option selected="">Open this select menu</option>
               <option value="1">One</option>
               <option value="2">Two</option>
               <option value="3">Three</option>
            </select>
         </div>
      );
   }
}

export default Calibration;
